#
# TABLE STRUCTURE FOR: earnings
#

DROP TABLE IF EXISTS `earnings`;

CREATE TABLE `earnings` (
  `earning_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(250) NOT NULL,
  `Purchaser_id` varchar(250) DEFAULT NULL,
