#
# TABLE STRUCTURE FOR: ext_document
#

DROP TABLE IF EXISTS `ext_document`;

CREATE TABLE `ext_document` (
  `ext_document_id` int(11) NOT NULL AUTO_INCREMENT,
  `ext_exchange_id` int(11) NOT NULL,
