  PRIMARY KEY (`ext_document_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ext_exchange
#

DROP TABLE IF EXISTS `ext_exchange`;

CREATE TABLE `ext_exchange` (
  `ext_exchange_id` int(11) NOT NULL AUTO_INCREMENT,
