  `usd_amount` varchar(100) NOT NULL,
  `local_amount` varchar(100) NOT NULL,
  `payment_method` varchar(100) NOT NULL,
  `request_ip` varchar(100) NOT NULL,
  `verification_code` varchar(100) NOT NULL,
  `payment_details` varchar(100) DEFAULT NULL,
  `rate_coin` varchar(100) DEFAULT NULL,
