  `data` text NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: fees_tbl
#

DROP TABLE IF EXISTS `fees_tbl`;

CREATE TABLE `fees_tbl` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
