  PRIMARY KEY (`notification_id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=latin1 COMMENT='SMS and Email notified data will be stored in this table.';



#
# TABLE STRUCTURE FOR: package
#

DROP TABLE IF EXISTS `package`;

CREATE TABLE `package` (
